import { ThemeProvider } from '@material-ui/styles';

function App() {
  return (
    <>
     <BrowserRouter>
      <Navbar />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/editions" element={<Editions />} />
        {/* <Route path="about/" element={<About />} />
        <Route path="contacts/" element={<Contacts />} /> */}
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
